import logo from '../assets/images/LOGOPRO.png';

class Main extends Component {
    render() {

        return (
            <React.Fragment>


            <div>
            <img src={logo} width="250px" style={{marginLeft:"450px"}}   className="corazon" alt="logotipo" />
            <br/>
            <h1 style={{marginLeft:"250px"}}  >Bienvenido al Restaurant SIGLO XXI</h1>
            </div>


            
            </React.Fragment>
        );
    }
}

export default Main;
